    // validate email
    function ValidateEmail(inputText) {
        var mailformat = /^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/;
        if (inputText.match(mailformat)) {
            return true;
        }
        else {
            return false;
        }
    }
    
    function isNumber(evt) {
        evt = (evt) ? evt : window.event;
        var charCode = (evt.which) ? evt.which : evt.keyCode;
        var ele_id = evt.target.id;
        var val = document.getElementById(ele_id).value;
        validateDecimal(val);
        var isNumeric = !(charCode > 31 && (charCode < 48 || charCode > 57));
    
        // input in amount field ,  numbers and decimals only
        if (ele_id == 'edit-field-amount-0-value') {
            if (document.getElementById(ele_id).selectionStart < val.length && !validateDecimal(val) && !(charCode > 31 && (charCode == 47 || charCode < 46 || charCode > 57))) {
                return true;
            }
            if (!isNumeric || (val.indexOf('.') > -1 && evt.key == '.') || !validateDecimal(val)) {
                return false;
            }
        }
        // input in CSV, only 3 digits allowed
        else if (ele_id == 'edit-field-csv-0-value') {
            if (charCode > 31 && (charCode < 48 || charCode > 57) || val.length == 4) {
                if (document.getElementById(ele_id).selectionStart < 4 && isNumeric) {
                    return true;
                }
                return false;
            }
        }
        // input in invoice, only 6 digits allowed
        else if (ele_id == 'edit-field-inv-0-value') {
            if (!isNumeric || val.length == 5) {
                if (document.getElementById(ele_id).selectionStart < 5 && isNumeric) {
                    return true;
                }
                return false;
            }
        }
        // input in phone, only 12 digits allowed
        else if (ele_id == 'edit-field-your-phone-0-value') {
            if (!isNumeric || val.length == 12) {
                if (document.getElementById(ele_id).selectionStart < 12 && isNumeric) {
                    return true;
                }
                return false;
            }
        }
        // input in card number, only 19 digits allowed (with spaces)
        else if (ele_id == 'edit-field-card-number-0-value') {
            //Add spaces
            if (val.length == 4) {
                document.getElementById(ele_id).value += ' ';
            } else if (val.length == 9) {
                document.getElementById(ele_id).value += ' ';
            } else if (val.length == 14) {
                document.getElementById(ele_id).value += ' ';
            }
            //
    
            if (!isNumeric || (val.length == 19)) {
                if (document.getElementById(ele_id).selectionStart < 19 && isNumeric) {
                    return true;
                }
                return false;
            }
        }
        else {
            if (!isNumeric) {
                return false;
            }
        }
        return true;
    }
    function validateDecimal(num) {
        if (num.indexOf(".") > 0 && num.substr(num.indexOf(".")).length > 2) {
            return false;
        }
        return true;
    }
